import UserItem from "./UserItem";

const UserList = (props) => {
  if (props.items.length === 0) {
    return <h2>Found no expenses.</h2>;
  }
  return (
    <ul>
      {props.items.map((user) => (
        <UserItem key={user.id} name={user.name} age={user.age} />
      ))}
    </ul>
  );
};

export default UserList;
